interface propData {
    Header: boolean,
    HeaderList: any,
    Checkbox: boolean,
}


const Table = (props: propData) => {
    return (
        <>
            <table className="table table-hover table-nowrap mb-0">
                {
                    props?.Header &&
                    <thead>
                        <tr>
                            {
                                props?.Checkbox &&
                                <th scope="col">
                                    <div className="form-check">
                                        <input className="form-check-input" type="checkbox" id="checkAll" value="option1" />
                                    </div>
                                </th>
                            }
                            {
                                props?.HeaderList && props?.HeaderList?.length > 0 && props?.HeaderList.map((res: any, i: any) => {
                                    return (
                                        <>
                                            <th scope="col" key={i}>{res.name ?? ''}</th>
                                        </>
                                    )
                                })
                            }
                        </tr>
                    </thead>
                }
                <tbody>
                    <tr>
                        {
                            props?.Checkbox &&
                            <th scope="row">
                                <div className="form-check">
                                    <input className="form-check-input" type="checkbox" id="inlineCheckbox2" value="option1" checked />
                                </div>
                            </th>
                        }
                        <td>#541254265</td>
                        <td>Amezon</td>
                        <td>Cleo Carson</td>
                        <td>$4,521</td>
                        <td><a href="javascript:void(0);"><i className="ri-download-2-line"></i></a></td>
                    </tr>
                </tbody>
            </table>
        </>
    )
}

export default Table;
